// client/src/App.js

import React from "react";
import logo from "./logo.svg";
import "./App.css";

function Item(props) {
  return <div>{props.text}</div>
}

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/get-data")
      .then((res) => res.json())
      .then((data) => setData(data.inclusions));
  }, []);
  if (!data) {
    return <div>Loading...</div>;
  }
  return (
    <div className="App">
      {data.map(item => 
        <Item key={item} text={item}/>
      )}
    </div>
  );
}

export default App;
